var title_f7_2_7200="Obesity all-cause mortality";
var content_f7_2_7200=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ENDO%2F73156&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ENDO%2F73156&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 600px\">",
"   <div class=\"ttl\">",
"    All-cause mortality versus BMI for each sex in the range 15 to 50 kg/m",
"    <sup>",
"     2",
"    </sup>",
"    (excluding the first five years of follow-up)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 580px; height: 697px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Relative risks at age 35 to 89 years, adjusted for age at risk, smoking, and study, were multiplied by a common factor (ie, floated) to make the weighted average match the PSC mortality rate at ages 35 to 79 years. Floated mortality rates shown above each square and numbers of deaths below. Area of square is inversely proportional to the variance of the log risk. Boundaries of BMI groups are indicated by tick marks. 95% CIs for floated rates reflect uncertainty in the log risk for each single rate. Dotted vertical line indicates 25 kg/m",
"    <sup>",
"     2",
"    </sup>",
"    (boundary between upper and lower BMI ranges in this report). Above 25 kg/m",
"    <sup>",
"     2",
"    </sup>",
"    , mortality was on average approximately 30 percent higher for every 5 kg/m",
"    <sup>",
"     2",
"    </sup>",
"    higher BMI.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Whitlock G, Lewington S, Sherliker P, et al. Body-mass index and cause-specific mortality in 900,000 adults: collaborative analyses of 57 prospective studies. Lancet 2009; 373:1083. Illustration used with the permission of Elsevier Inc. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
