var title_f7_2_7201="Wing block";
var content_f7_2_7201=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F74358&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F74358&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 524px\">",
"   <div class=\"ttl\">",
"    Wing block",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 504px; height: 358px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Holding the syringe at a 45 degree angle to the plane of the table and perpendicular to the long axis of the digit, insert the needle a short distance to enter the deep intradermal tissue of the dorsum of the digit at a point approximately 3 mm proximal to an imaginary point where a linear extension of the lateral and proximal nail folds would intersect. Inject the anesthetic into the intradermal tissue, first infiltrating the proximal nail fold; the needle can be advanced to allow infiltration along the proximal nail fold. The needle is then partially withdrawn and redirected to allow infiltration of the intradermal tissue along the lateral nail fold. As the anesthetic is injected, the folds blanch and distend creating a wing-like appearance.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
