var content_f7_2_7209=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F69017&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F69017&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 632px\">",
"   <div class=\"ttl\">",
"    NIH consensus criteria for organ scoring of chronic GVHD",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 612px; height: 1354px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     GVHD: graft-versus-host disease; KPS: Karnofsky Performance Status; ECOG: Eastern Cooperative Oncology Group; LPS: Lansky Performance Status; BSA: body surface area; ADL: activities of daily living; LFTs: liver function tests; AP: alkaline phosphatase; ALT: alanine aminotransferase; AST: aspartate aminotransferase; ULN: upper limit of normal.",
"     <br>",
"      * AP may be elevated in growing children, and not reflective of liver dysfunction.",
"      <br>",
"       <span class=\"bullet\">",
"        &bull;",
"       </span>",
"       Pulmonary scoring should be performed using both the symptom and pulmonary function testing (PFT) scale whenever possible. When discrepancy exists between pulmonary symptom or PFT scores the higher value should be used for final scoring. Scoring using the Lung Function Score (LFS) is preferred, but if DLCO is not available, grading using FEV1 should be used. The LFS is a global assessment of lung function after the diagnosis of bronchiolitis obliterans has already been established. The percent predicted FEV1 and DLCO (adjusted for hematocrit but not alveolar volume) should be converted to a numeric score as follows: &gt;80 percent = 1; 70 to 79 percent = 2; 60 to 69 percent = 3; 50 to 59 percent = 4; 40 to 49 percent = 5; &lt;40 percent = 6. The LFS = FEV1 score + DLCO score, with a possible range of 2 to 12.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Filipovich AH, Weisdorf D, Pavletic S, et al. National Institutes of Health consensus development project on criteria for clinical trials in chronic graft-versus-host disease: I. Diagnosis and staging working group report. Biol Blood Marrow Transplant 2005; 11:945. Table used with the permission of Elsevier Inc. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
