var title_f7_2_7211="Neurologic causes vulvar pain";
var content_f7_2_7211=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F65491&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F65491&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Neurologic triggers of vulvar pain",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td>",
"       Referred pain from the piriformis, pubococcygeus, obturator internus and externus muscles, or sacroiliac joint due to injury, spasm, dysfunction, or orthopedic conditions affecting these muscles and joints (eg, injury to back, hips, or knees, repetitive musculoskeletal or postural stressors)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Referred pain from a ruptured disc or scarring around sacral nerve roots after disc surgery or from spinal stenosis or significant spinal arthritis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Multiple sclerosis or neurofibromatosis",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Pudendal nerve injury related to labor and delivery, recreational activities (horseback riding, biking), vaginal or transvaginal surgery",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Postherpetic neuralgia from herpes zoster",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Pudendal nerve entrapment",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Sacral-menigeal (Tarlov's) cysts",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Bachmann G, Rosen RC. Vulvodynia and menopause. Menopause Management. March/April 2006, pages 14-21.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
