var title_f7_2_7212="ACC AHA CV risk noncard surgery";
var content_f7_2_7212=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F57828&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F57828&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    ACC/AHA guideline summary: Cardiac risk stratification for noncardiac surgical procedures",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        High risk (reported risk of cardiac death or nonfatal myocardial infarction [MI] often)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Aortic and other major vascular surgery",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Peripheral artery surgery",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Intermediate risk (reported risk of cardiac death or nonfatal MI generally 1 to 5 percent)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Carotid endarterectomy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Head and neck surgery",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Intraperitoneal and intrathoracic surgery",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Orthopedic surgery",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Prostate surgery",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Low risk* (reported risk of cardiac death or nonfatal MI generally less than 1 percent)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Ambulatory surgery",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Endoscopic procedures",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Superficial procedure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Cataract surgery",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        &bull; Breast surgery",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Do not generally require further preoperative cardiac testing.",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Fleisher LA, Beckman JA, Brown KA, et al. ACC/AHA 2007 guidelines on perioperative cardiovascular evaluation and care for noncardiac surgery: a report of the American College of Cardiology/American Heart Association Task Force on Practice Guidelines (Writing Committee to Revise the 2002 Guidelines on Perioperative Cardiovascular Evaluation for Noncardiac Surgery) developed in collaboration with the American Society of Echocardiography, American Society of Nuclear Cardiology, Heart Rhythm Society, Society of Cardiovascular Anesthesiologists, Society for Cardiovascular Angiography and Interventions, Society for Vascular Medicine and Biology, and Society for Vascular Surgery. J Am Coll Cardiol 2007; 50:e159.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
